package de\.adesso\.Service\;


import org\.springframework\.beans\.factory\.annotation\.Autowired\;
import org\.springframework\.stereotype\.Component\;
import de\.adesso\.Entity\.\*\;
import de\.adesso\.Repository\.\*\;

\@Component
public class UserService \{

\ \@Autowired
\ private UserRepository userRepository\;

\ public UserService\(UserRepository userRepository\) \{
\ \ this\.userRepository \= userRepository\;
\ \}

\ public String createUser\(String email\, String name\) \{
\ \ String userId \= ""\;
\ \ try \{
\ \ \ User newUser \= new User\(email\, name\)\;
\ \ \ userRepository\.save\(newUser\)\;
\ \ \ userId \= String\.valueOf\(newUser\.getId\(\)\)\;
\ \ \} catch \(Exception ex\) \{
\ \ \ return "Error creating the user\: " \+ ex\.toString\(\)\;
\ \ \}
\ \ return "user succesfully created with id \= " \+ userId\;
\ \}

\ public String delete\(int id\) \{
\ \ try \{
\ \ \ User UserWithId \= new User\(id\)\;
\ \ \ userRepository\.delete\(UserWithId\)\;
\ \ \} catch \(Exception ex\) \{
\ \ \ return "Error deleting the user\:" \+ ex\.toString\(\)\;
\ \ \}
\ \ return "user succesfully deleted\!"\;
\ \}

\ public Iterable\<User\> findUsersByEmail\(String email\) \{
\ \ return userRepository\.findByEmail\(email\)\;
\ \}

\ public String updateUser\(int id\, String email\, String name\) \{
\ \ try \{
\ \ User FoundUser \= userRepository\.findOne\(id\)\;
\ \ FoundUser\.setEmail\(email\)\;
\ \ FoundUser\.setName\(name\)\;
\ \ \ userRepository\.save\(FoundUser\)\;
\ \ \}
\ \ catch \(Exception ex\) \{
\ \ return "Error updating the user\: " \+ ex\.toString\(\)\;
\ \ \}
\ \ return "user succesfully updated\!"\;
\ \}
\ 
\ public Iterable\<User\> getAllUser\(\)\{
\ \ return userRepository\.findAll\(\)\;
\ \}

\}
